import React from "react";

export default function LabelCard(props) {
  const labelCss = {
    "font-size": "17px",
    width: "12%",
    display: "flex",
    "justify-content": "center",
    "align-items": "center",
    background: "#f2f2f2",
    height: "69%",
    "border-radius": "11px"
  };
  return <div className={labelCss}>{props.label}</div>;
}
